import React from "react";
import { NavLink } from "react-router-dom";

const myComponentStyle = {
  fontFamily: 'sans-serif, "Helvetica Neue", "Lucida Grande", Arial',
  fontStretch: 'expanded',
};


const Navbar = () => {
  return (
    <>
    
    <nav className="navbar navbar-expand-lg navbar-light bg-light container-fluid">
    <NavLink className="navbar-brand fst-italic" style={myComponentStyle} to="#">GoFood</NavLink>
  <NavLink className="navbar-brand" to="#">Home</NavLink>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>

  <div className="collapse navbar-collapse" id="navbarSupportedContent">
    <ul className="navbar-nav me-auto mb-2">
      <li className="nav-item active">
        {/* <NavLink class="nav-link" to="#">Home </NavLink> */}
      </li>
     
      <li className="nav-item">
        <NavLink className="nav-link " to="#">Link</NavLink>
      </li>
     
      <li className="nav-item">
        {/* <NavLink className="nav-link disabled" to="#">Disabled</NavLink> */}
      </li>
    </ul>
    <div  className="d-flex"style={{marginLeft:"auto"}}>
   <NavLink to={"/Login"}> <button type="button" class="btn btn-primary btn-lg" href='/Login'>Login</button></NavLink>
  <NavLink to={"/Signup"}> <button type="button" class="btn btn-secondary btn-lg" href='/Login'>Signup</button></NavLink> 

    </div>
    
    
   
  </div>
</nav>
    
      
    </>
  );
};

export default Navbar;
